sidebarCSS:
#root.root {--tabs-pinned-height: 42px;}
#root.root {--tabs-pinned-width: 42px;}
#root.root {--tabs-activated-bg: var(--s-popup-bg);}
#root.root {--nav-btn-height: var(--tabs-height);}
#root.root {--nav-btn-width: var(--tabs-height);}
#root.root {--toolbar-bg: #2b2b36;}
#root.root {--frame-bg: var(--s-toolbar-bg);}
#root.root {--general-margin: 3px;}
#root.root {--tabs-inner-gap: 10px;}
#root.root {--tabs-height: 42px;}

#root.root {--hardcode-width: 400px;}

/* Background layer */

.Tab {
	.body	{
		transition: margin-left .2s, width .2s;
		&:hover	{
			margin-left: 2px;
			width: calc(100% - 2px);
		}
	}
  width: unset;

	/* Resize and reposition favicons */
	.fav {
		display: inline-block;
 		scale: 1.5;
		margin: 0 100px;

		.exp, .child-count	{
			scale: 0.8;
			transition: scale .1s;
			&:hover	{
				scale: 1.1;
			}
		}
	}
	.placeholder > svg, .fav-icon {
		width: 80%;
		height: 80%;
		top: 10%;
		left: 10%;
	}

	/* two line title thingy */
  --tabs-title-padding: 8px;
  --tabs-font-size: .8rem;
  --tabs-title-lines: 2;
	--indent-amount: 0;
	&[data-lvl="0"]{--indent-amount:0;}
	&[data-lvl="1"]{--indent-amount:1;}
	&[data-lvl="2"]{--indent-amount:2;}
	&[data-lvl="3"]{--indent-amount:3;}
	&[data-lvl="4"]{--indent-amount:4;}

	.t-box {
  	align-items: center;
  	max-height: calc(var(--tabs-height) - var(--tabs-title-padding));
  	overflow: hidden;
		border-right: 1px solid transparent;
	}
	.title {
  	font-size: var(--tabs-font-size);
		width: calc(var(--hardcode-width) - 10px * var(--indent-amount) - var(--tabs-height)*2 - var(--general-margin)*5);
  	white-space: pre-wrap;
  	line-height: calc((var(--tabs-height) - var(--tabs-title-padding)) / var(--tabs-title-lines));
	}
}

.new-tab-btns, .bottom-space, .new-tab-btns::after	{
	background-color: inherit !important;
}
.NavigationBar > .main-items	{
	margin: 0 var(--general-margin);
	transition: width .15s, opacity .2s;
	width: 0;
	opacity: 0;

	.audio	{
		background-color: transparent;
  	box-shadow: none;
		margin: 5px;
	}
}
.central-box, .main-box {
	transition: background .2s;
	background: var(--toolbar-bg);
}
.central-box, #nav_bar {
	margin-top: 0 !important;
	padding-top: 10px;
}
#root	{
	--tabs-indent: unset;
	&:hover	{
		--tabs-indent: 10px;
		.NavigationBar > .main-items	{
			width: var(--nav-btn-width);
			opacity: 1;
		}
		.central-box, .main-box {
			background: var(--frame-bg);
		}
	}
}
@media screen and (min-width: 390px)	{	
	.central-box, .main-box {
		background: var(--frame-bg);
	}
	#root	{
		--tabs-indent: 10px;
	}
	.NavigationBar > .main-items	{
		opacity: 1;
		width: var(--nav-btn-width);
	}
}

/* Adjust styles according to sidebar width */
@media screen and (max-width: 48px) {
	#root.root	{	
		--tabs-activated-bg: var(--frame-bg);
	}
  .ScrollBox > .scroll-container {
    overflow: hidden;
  }
  .Tab	{ 
		.audio {
    	transform: scale(.80);
    	transform: translate(-10px, 6px);
    	z-index: 99 !important;
  	}
  	.title {
    	visibility: collapse;
  	}
	}
	.BottomBar {
		visibility: collapse;
	}
	.main-box .right-vertical-box {
		visibility: collapse;
	}	
}
